const products = [
  {
    id: 1,
    name: 'Casual',
    href: '/tops',
    imageSrc: 'https://static.zara.net/assets/public/9acb/c200/0c98484b8b7e/c59ea7db276e/00706430401-e1/00706430401-e1.jpg?ts=1727185909823&w=449',
    imageAlt: 'Top',
  },
  {
    id: 2,
    name: 'Sports',
    href: '/bottoms',
    imageSrc: 'https://static.zara.net/assets/public/1414/1c6e/a8464bea8776/3e733339617d/04048300800-e1/04048300800-e1.jpg?ts=1730711203184&w=449',
    imageAlt: 'Bottom',
  },
  {
    id: 3,
    name: 'Formal',
    href: '/shoes',
    imageSrc: 'https://static.zara.net/assets/public/609d/0608/a79b4615b554/6f994e7ab647/12305420800-e1/12305420800-e1.jpg?ts=1727036261583&w=449',
    imageAlt: 'Shoes',
  },
  {
    id: 4,
    name: 'Boots',
    href: '/perfume',
    imageSrc: 'https://static.zara.net/assets/public/48dc/26df/98254bea91fe/0d7f2730c39d/20210734999-e1/20210734999-e1.jpg?ts=1724685067054&w=449',
    imageAlt: 'Perfume',
  },
  {
    id: 5,
    name: 'Slippers',
    href: '/perfume',
    imageSrc: 'https://static.zara.net/assets/public/48dc/26df/98254bea91fe/0d7f2730c39d/20210734999-e1/20210734999-e1.jpg?ts=1724685067054&w=449',
    imageAlt: 'Perfume',
  },
  {
    id: 6,
    name: 'Designer Shoes',
    href: '/perfume',
    imageSrc: 'https://static.zara.net/assets/public/48dc/26df/98254bea91fe/0d7f2730c39d/20210734999-e1/20210734999-e1.jpg?ts=1724685067054&w=449',
    imageAlt: 'Perfume',
  },
  {
    id: 7,
    name: 'Jordans',
    href: '/perfume',
    imageSrc: 'https://static.zara.net/assets/public/48dc/26df/98254bea91fe/0d7f2730c39d/20210734999-e1/20210734999-e1.jpg?ts=1724685067054&w=449',
    imageAlt: 'Perfume',
  },
]

export default function Example() {
  return (
    <div className="bg-white">
      <div className="mx-auto max-w-2xl px-4 py-16 sm:px-6 sm:py-24 lg:max-w-7xl lg:px-8">
        <h2 className="sr-only">Products</h2>

        <div className="grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 xl:gap-x-8">
          {products.map((product) => (
            <a key={product.id} href={product.href} className="group">
              <img
                alt={product.imageAlt}
                src={product.imageSrc}
                className="aspect-square w-full rounded-lg bg-gray-200 object-cover group-hover:opacity-75 xl:aspect-[7/8]"
              />
              <h3 className="mt-4 text-sm text-gray-700">{product.name}</h3>
              <p className="mt-1 text-lg font-medium text-gray-900">{product.price}</p>
            </a>
          ))}
        </div>
      </div>
    </div>
  )
}
